#Perform some updates on 'self-documenting fields' which I do not belive the
#Application displays, but are easiest populated in an automatic fachion like below.
set @p_is_mot_trigger_disabled = TRUE;
call mot2.set_mot_trigger_disabled(@p_is_mot_trigger_disabled);
select @p_is_mot_trigger_disabled;

UPDATE reason_for_rejection
set test_item_selector_name =
(select if (tclcm1.name = tclcm2.name OR tclcm2.name = 'RFR Home', tclcm1.name, concat(tclcm2.name,' > ',   tclcm1.name))
from test_item_category tic1 
join ti_category_language_content_map tclcm1 on tic1.id = tclcm1.test_item_category_id and tclcm1.language_lookup_id = 1
join ti_category_language_content_map tclcm2 on tic1.parent_test_item_category_id = tclcm2.test_item_category_id and tclcm2.language_lookup_id = 1
where tic1.id = reason_for_rejection.test_item_category_id
limit 1) ,
test_item_selector_name_cy =
(select if (tclcm1.name = tclcm2.name OR tclcm2.name = 'RFR Home', tclcm1.name, concat(tclcm2.name,' > ',   tclcm1.name))
from test_item_category tic1 
join ti_category_language_content_map tclcm1 on tic1.id = tclcm1.test_item_category_id and tclcm1.language_lookup_id = 1
join ti_category_language_content_map tclcm2 on tic1.parent_test_item_category_id = tclcm2.test_item_category_id and tclcm2.language_lookup_id = 1
where tic1.id = reason_for_rejection.test_item_category_id
limit 1),
section_test_item_selector_id = 
(select section_test_item_category_id from test_item_category tic1 
where tic1.id = reason_for_rejection.test_item_category_id)
where reason_for_rejection.id >= 20000;


update rfr_language_content_map
set test_item_selector_name = 
(select test_item_selector_name from reason_for_rejection
 where reason_for_rejection.id = rfr_language_content_map.rfr_id)
where rfr_language_content_map.language_type_id = 1
and   rfr_language_content_map.rfr_id > 19999;



SET @welsh_prefix = 'Welsh: ';

SELECT test_item_category_id,2, concat(@welsh_prefix, `name`) as `name`,
  concat(@welsh_prefix,`description`) as `description`, @app_user_id
FROM ti_category_language_content_map
WHERE test_item_category_id > 19999
AND   language_lookup_id = 1;

SELECT `rfr_id`, 2, concat(@welsh_prefix, `name`) as `name`,
       concat(@welsh_prefix, `inspection_manual_description`) as `inspection_manual_description`,
       concat(@welsh_prefix, `advisory_text`) as `advisory_text`, @app_user_id
FROM rfr_language_content_map
WHERE rfr_id > 19999
AND language_type_id = 1;


# Re-instate Non-Component advisories just so that no-one forgets about them.
# In case they are not covered in new EU manuals properly.
UPDATE test_item_category
SET end_date = null
WHERE id = 10000;

UPDATE reason_for_rejection
SET end_date = null
WHERE test_item_category_id = 10000;

# Re-instate Item Not Tested Components used by VEs
UPDATE test_item_category
SET end_date = null
WHERE id in (5800, 5801, 5803, 536, 537);

# Make sure the old Item Not Tested RFRs are ended.
UPDATE reason_for_rejection
SET end_date = @start_date
WHERE test_item_category_id in (5800, 5801, 5803, 536, 537)
AND rfr_deficiency_category_id = 0
AND end_date is null;


